import React from "react";
import backgroundImage from "../../assets/dhruvi.png";
import { Link } from "react-scroll";
import bag from "../../assets/bag.png";

const Introduction = () => {
  return (
    <section id="introduction">
      <div className="introductionContent">
        <span className="hey">Hey,</span>
        <br />
        <span className="introductionText">
          I'm <span className="introductionName">Dhruvi</span>
          <br />
          Full-Stack Developer
        </span>
        <p className="introductionDescription">
          I'm a curious and attention to detail type of person who like to
          develop user friendly website and application
        </p>
        <Link>
          <button className="btn">
            <img src={bag} alt="Hire Me" />
            Hire me
          </button>
        </Link>
      </div>
      <img
        src={backgroundImage}
        alt="backgroundImage"
        className="backgroundImage"
      />
    </section>
  );
};

export default Introduction;
